import React from "react"
import {Link } from "@reach/router"
import {Toolbar} from "@material-ui/core"

export default function NavBar() {
    return (
        <Toolbar style={{display: "flex", justifyContent: "space-evenly"}}>

        <Link to="/newpost" style={{justifyContent: "left"}}>Create New Post</Link>

        <Link to="/" style={{justifyContent: "center"}}>The H A P</Link>
        <Link to="/dashboard" className="justify-content-end nav">Dashboard</Link>
        </Toolbar>
    )
}
